import TodoCard from "./TodoCard"

const TodoList = ({todos}) => {
    const renderTodos = todos.map(todos => <TodoCard key={todos.id} todos={todos}/>)
    return (
        <div>{renderTodos}</div>
    )
}

export default TodoList
